var tipuesearch = {"pages":[{"tags":"misc","title":"About","url":"./pages/about/","text":"2017Spring 機械設計工程系網際內容管理 課程倉儲: http://github.com/mdecourse/2017springwcm 課程投影片: http://mdecourse.github.io/2017springwcm 課程網誌: http://mdecourse.github.io/2017springwcm/blog"},{"tags":"Misc","title":"2017網際內容管理之虛擬主機","url":"./2017wang-ji-nei-rong-guan-li-zhi-xu-ni-zhu-ji.html","text":"虛擬主機使用方式!!! 其實只是心得文而已 老師向我們示範這一套虛擬主機軟體 透過虛擬主機 我們也可以進行網頁Blog製作 我是第一次接觸這種虛擬主機 老實說我完全沒有任何頭緒 所以在此沒辦法說出學到任何東西 只覺得非常複雜 就是這樣的一篇心得文 謝謝老師的教導 我之後也還是會認真聽講 也會試著自己操作上課所學到的東西 祝老師身體健康 祝我能夠及格!!!!"},{"tags":"Misc","title":"2017網際內容管理之網路線製作","url":"./2017wang-ji-nei-rong-guan-li-zhi-wang-lu-xian-zhi-zuo.html","text":"學習自己製作網路線、跳線 做這個好像非常賺錢 我們要製作一般網路線 以及 跳線 先將網路線兩端的前端塑膠皮剝除 再套入網路線接頭 兩端都要套入正確方向 之後將露出來的網路線轉開 成一條一條的狀態 而一般網路線的排列順序為: 設線兩端分別為A端及B端 ． A端 白橙 - 橙 - 白綠 - 藍 - 白藍 - 綠 - 白棕 - 棕 ． B端 白橙 - 橙 - 白綠 - 藍 - 白藍 - 綠 - 白棕 - 棕 排列好後 把每條線剪平並注意 塑膠皮要塞進網路線接頭 所以不能去除太多 剛好可以讓接頭咬住塑膠皮即可 接頭內有8個軌道供網路線插入 將內線排好 一起塞入接頭 要注意一個軌道只能一條內線進入 並且順序要對 確認有內線有插到底 順序沒有錯誤 就可拿出壓線鉗 上方有一個剛好吻合網路線接頭的洞 塞進去聽到 喀!一聲 代表接頭有卡住 壓緊壓線鉗 直到壓線鉗自己鬆開 這樣就完成一條網路線!!! 而跳線的排列順序為: 設線兩端分別為A端及B端 ． A端 白橙 - 橙 - 白綠 - 藍 - 白藍 - 綠 - 白棕 - 棕 ． B端 白綠 - 綠 - 白橙 - 藍 - 白藍 - 橙 - 白棕 - 棕"}]};